import React, { useState, useEffect } from 'react';
import config from './config'; 
import landingBanner from './images/banner.png'
import './LandingPage.css';
import { Link } from 'react-router-dom';

function LandingPage() {
    return (
        <div className='LandingPage'>
            <img src={landingBanner} alt="New seasonal item banner of the Hello Kitty Crush drink at Tiger Sugar"/>

            <Link to="/order">
                <button alt="Order button">Order Here</button>
            </Link>

            <Link to="/menu">
                <button alt="Menu button">Menu</button>
            </Link>

        </div>
    );
}

export default LandingPage;
